void make_splash_pixmaps(GtkWidget *window)
{
(void) window;

GLOBALS->wave_splash_pixbuf = gdk_pixbuf_new_from_xpm_data((const gchar **)wave_splash_xpm);
}


#if GTK_CHECK_VERSION(3,0,0)
static gint draw_event(GtkWidget *widget, cairo_t *cr, gpointer      user_data)
{
(void) widget;
(void) user_data;

gdk_cairo_set_source_pixbuf (cr, GLOBALS->wave_splash_pixbuf, 0.0, 0.0);
cairo_paint (cr);

cairo_set_line_width(cr, 1.0);
cairo_set_source_rgba (cr, 0.0, 0.0, 0.0, 1.0);
cairo_rectangle (cr, 0,WAVE_SPLASH_Y-4, GLOBALS->prev_bar_x_splash_c_1, 4);
cairo_fill(cr);

return(FALSE);
}
#else
static gint expose_event(GtkWidget *widget, GdkEventExpose *event)
{
#ifdef WAVE_ALLOW_GTK3_CAIRO_CREATE_FIX
GdkDrawingContext *gdc;
#endif
cairo_t* cr = XXX_gdk_cairo_create (XXX_GDK_DRAWABLE (gtk_widget_get_window(widget)), &gdc);
gdk_cairo_region (cr, event->region);
cairo_clip (cr);

gdk_cairo_set_source_pixbuf (cr, GLOBALS->wave_splash_pixbuf, 0.0, 0.0);
cairo_paint (cr);

#ifdef WAVE_ALLOW_GTK3_CAIRO_CREATE_FIX
gdk_window_end_draw_frame(gtk_widget_get_window(widget), gdc);
#else
cairo_destroy (cr);
#endif

return(FALSE);
}
#endif

gint splash_button_press_event(GtkWidget *widget, GdkEventExpose *event)
{
(void)widget;
(void)event;

if(GLOBALS->timeout_tag) { g_source_remove(GLOBALS->timeout_tag); GLOBALS->timeout_tag = 0; }

if(GLOBALS->wave_splash_pixbuf)
      	{
        g_object_unref(GLOBALS->wave_splash_pixbuf); GLOBALS->wave_splash_pixbuf = NULL;
        }

if(GLOBALS->splash_splash_c_1)
	{
        gtk_widget_destroy(GTK_WIDGET(GLOBALS->splash_splash_c_1)); GLOBALS->splash_splash_c_1 = NULL;
        }

if(GLOBALS->gt_splash_c_1)
	{
	g_timer_destroy(GLOBALS->gt_splash_c_1); GLOBALS->gt_splash_c_1 = NULL;
	}

return(FALSE);
}


gint splash_kill(gpointer dummy)
{
(void)dummy;

gulong usec;
if(GLOBALS && GLOBALS->gt_splash_c_1)
	{
	gint sec = (gint) g_timer_elapsed(GLOBALS->gt_splash_c_1, &usec);
	int skill = (sec>=2);

	if(GLOBALS->cnt_splash_c_1) GLOBALS->cnt_splash_c_1 -= GLOBALS->load_complete_splash_c_1;

	if((!GLOBALS->cnt_splash_c_1)&&(skill))
		{
		return(splash_button_press_event(NULL,NULL));
		}
		else
		{
		if(!GLOBALS->load_complete_splash_c_1) gdk_window_raise(gtk_widget_get_window(GTK_WIDGET(GLOBALS->splash_splash_c_1)));
		}
	}

return(1);
}


void splash_create(void)
{
if((!GLOBALS->splash_disable)&&(!GLOBALS->splash_splash_c_1))
        {
        GtkWidget *splash_table;
	gint dx, dy;

	GLOBALS->gt_splash_c_1 = g_timer_new();

#if defined __MINGW32__
#if GTK_CHECK_VERSION(3,0,0)
        GLOBALS->splash_splash_c_1 = gtk_window_new(GTK_WINDOW_TOPLEVEL); /* workaround for black bar missing on gtk3 on win32/64 */
#else
        GLOBALS->splash_splash_c_1 = gtk_window_new(GTK_WINDOW_POPUP);
#endif
#else
        GLOBALS->splash_splash_c_1 = gtk_window_new(GTK_WINDOW_POPUP);
#endif

#if !defined __MINGW32__
#ifdef WAVE_ALLOW_GTK3_GRID
	dx = 0; dy = 0; /* necessary if GtkGrid is used instead of GtkTable */
#else
	dx = 8; dy = 8;
#endif
#else
	dx = 8; dy = 8;
#endif
        gtk_widget_set_size_request(GTK_WIDGET(GLOBALS->splash_splash_c_1), WAVE_SPLASH_X + dx, WAVE_SPLASH_Y + dy);
        gtk_window_set_type_hint(GTK_WINDOW(GLOBALS->splash_splash_c_1), GDK_WINDOW_TYPE_HINT_SPLASHSCREEN);
        gtk_window_set_position(GTK_WINDOW(GLOBALS->splash_splash_c_1), GTK_WIN_POS_CENTER);
        gtk_widget_show(GLOBALS->splash_splash_c_1);

        make_splash_pixmaps(GLOBALS->splash_splash_c_1);

        splash_table = XXX_gtk_table_new(10, 10, FALSE);
        GLOBALS->darea_splash_c_1 = gtk_drawing_area_new();
        gtk_widget_show(GLOBALS->darea_splash_c_1);
	gtk_widget_set_events(GLOBALS->darea_splash_c_1, GDK_EXPOSURE_MASK | GDK_BUTTON_PRESS_MASK);

        XXX_gtk_table_attach (XXX_GTK_TABLE (splash_table), GLOBALS->darea_splash_c_1, 0, 9, 0, 9,GTK_FILL | GTK_EXPAND,GTK_FILL | GTK_EXPAND | GTK_SHRINK, 3, 3);

        gtk_widget_show(splash_table);
        gtk_container_add(GTK_CONTAINER(GLOBALS->splash_splash_c_1), splash_table);
#if GTK_CHECK_VERSION(3,0,0)
	gtkwave_signal_connect(XXX_GTK_OBJECT(GLOBALS->darea_splash_c_1), "draw",G_CALLBACK(draw_event), NULL);
#else
	gtkwave_signal_connect(XXX_GTK_OBJECT(GLOBALS->darea_splash_c_1), "expose_event",G_CALLBACK(expose_event), NULL);
#endif
	gtkwave_signal_connect(XXX_GTK_OBJECT(GLOBALS->darea_splash_c_1), "button_press_event",G_CALLBACK(splash_button_press_event), NULL);

	gtk_events_pending_gtk_main_iteration();


#ifdef WAVE_ALLOW_GTK3_CAIRO_CREATE_FIX
	GdkDrawingContext *gdc;
#endif
	cairo_t* cr = XXX_gdk_cairo_create (XXX_GDK_DRAWABLE (gtk_widget_get_window(GLOBALS->darea_splash_c_1)), &gdc);
	cairo_rectangle (cr, 0, 0, WAVE_SPLASH_X,WAVE_SPLASH_Y);
	cairo_clip (cr);

	gdk_cairo_set_source_pixbuf (cr, GLOBALS->wave_splash_pixbuf, 0.0, 0.0);
	cairo_paint (cr);

#ifdef WAVE_ALLOW_GTK3_CAIRO_CREATE_FIX
	gdk_window_end_draw_frame(gtk_widget_get_window(GLOBALS->darea_splash_c_1), gdc);
#else
	cairo_destroy (cr);
#endif

	gtk_events_pending_gtk_main_iteration();

        GLOBALS->timeout_tag = g_timeout_add(100, splash_kill, GLOBALS->splash_splash_c_1);
        }
	else
	{
/* was commented out for now because of DnD while loading crash */
#ifdef SPLASH_ADDED_LOADER_MESSAGES
	if(GLOBALS->mainwindow)
		{
		wave_gtk_window_set_title(GTK_WINDOW(GLOBALS->mainwindow), GLOBALS->winname, WAVE_SET_TITLE_LOADING, 0);
		}
#endif
	}
}

void splash_sync(off_t current, off_t total)
{
struct Global *g_old = GLOBALS;
int cur_bar_x;

if(GLOBALS->splash_splash_c_1)
	{
	if((current)&&(total))
		{
#if defined __MINGW32__
#if GTK_CHECK_VERSION(3,0,0)
		gdk_window_raise(gtk_widget_get_window(GLOBALS->splash_splash_c_1));
#endif
#endif
		cur_bar_x = WAVE_SPLASH_X * ((float)current / (float)total);

		if(cur_bar_x != GLOBALS->prev_bar_x_splash_c_1)
			{
			if((current==total)||(cur_bar_x>=WAVE_SPLASH_X-4)) GLOBALS->load_complete_splash_c_1=1;
			/* if(current>total) current = total; */ /* scan-build */

#ifdef WAVE_ALLOW_GTK3_CAIRO_CREATE_FIX
			GdkDrawingContext *gdc;
#endif
		        cairo_t* cr = XXX_gdk_cairo_create (XXX_GDK_DRAWABLE (gtk_widget_get_window(GLOBALS->darea_splash_c_1)), &gdc);
			cairo_set_line_width(cr, 1.0);
		        cairo_set_source_rgba (cr, 0.0, 0.0, 0.0, 1.0);
        		cairo_rectangle (cr, 0,WAVE_SPLASH_Y-4, (GLOBALS->prev_bar_x_splash_c_1 = cur_bar_x), 4);
			cairo_fill(cr);
#ifdef WAVE_ALLOW_GTK3_CAIRO_CREATE_FIX
			gdk_window_end_draw_frame(gtk_widget_get_window(GLOBALS->darea_splash_c_1), gdc);
			gtk_widget_queue_draw_area(GLOBALS->darea_splash_c_1, 0, WAVE_SPLASH_Y-4, cur_bar_x, 4); /* needed for wayland */
#else
			cairo_destroy (cr);
#endif
			}
		}

	gtk_events_pending_gtk_main_iteration();
	}
	else
	{
#ifdef SPLASH_ADDED_LOADER_MESSAGES
	if((GLOBALS->mainwindow)&&(!GLOBALS->tcl_running))
		{
		if(!GLOBALS->splash_is_loading)
			{
			set_window_busy_no_refresh(GLOBALS->mainwindow);
			GLOBALS->splash_is_loading = 1;
#ifdef MAC_INTEGRATION
		        osx_menu_sensitivity(FALSE);
#endif
			}

		if((current)&&(total))
			{
			cur_bar_x = 100 * ((float)current / (float)total);
			if(cur_bar_x != GLOBALS->prev_bar_x_splash_c_1)
				{
				GLOBALS->prev_bar_x_splash_c_1 = cur_bar_x;
				wave_gtk_window_set_title(GTK_WINDOW(GLOBALS->mainwindow), GLOBALS->winname, WAVE_SET_TITLE_LOADING, cur_bar_x);
				if(0) 	{
					GdkDisplay *g = gdk_display_get_default();
					if(g) gdk_display_flush(g);
					}
					else
					{
					gtk_events_pending_gtk_main_iteration();
					set_GLOBALS(g_old);
					}

				}
			}
		}
#endif
	}
}


void splash_finalize(void)
{
if(GLOBALS->splash_is_loading)
        {
        GLOBALS->splash_is_loading = 0;
	GLOBALS->splash_fix_win_title = 1;
        set_window_idle(GLOBALS->mainwindow);
#ifdef MAC_INTEGRATION
        osx_menu_sensitivity(TRUE);
#endif
        }
}

